import React from "react";
import { Link } from "react-router-dom";

import "./style.css";

import banner1 from "../../../Asset/img/banner/banner-1.jpg";
import banner2 from "../../../Asset/img/banner/banner-2.jpg";
import banner3 from "../../../Asset/img/banner/banner-3.jpg";

const Banner = () => {
  return (
    <section className="w-full bg-gray-300 flex justify-center">
      <div className="banner container bg-white p-4 flex flex-wrap md:flex-nowrap   gap-4">
        {/* Women */}
        <div className="md:w-1/3 w-1/2 h-full bg-orange-500">Men</div>
        {/* Men */}
        <div className="w-1/3 h-full bg-purple-600">Women</div>
        <div className="w-1/3 h-full bg-red-600">
          {/* Child */}
          <div className="w-full h-1/2">Child</div>
          {/* Accessories */}
          <div className="w-full h-1/2">Accessories</div>
        </div>
      </div>
    </section>
  );
};

export default Banner;
